import React, { Component } from "react";

const SearchBar = props => {
  return (
    <div className="search-bar">
      <input
        name="searchTerm"
        type="text"
        placeholder="search..."
        onChange={props.handleSearch}
        value={null}
      />
    </div>
  );
};

export default SearchBar;
